import React from 'react';
import { Pie } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

const Types = () => {

  const asdf = {
    dataPie: {
      labels: ["America", "UK", "Mexico", "Germany", "Japan"],
      datasets: [
        {
          data: [11, 11, 11, 11, 11],
          backgroundColor: [
            "red",
            "blue",
            "yellow",
            "green",
            "brown",
          ],
          hoverBackgroundColor: [
            "red",
            "blue",
            "yellow",
            "green",
            "brown",
          ]
        }
      ]
    }
  }

  return (
    <MDBContainer>
      <h3 className="mt-5">Country of Origin</h3>
      <Pie data={asdf.dataPie} options={{ responsive: true }} />
    </MDBContainer>
  )
}

export default (Types);
